import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import PaperTrade from './PaperTrade';
import reportWebVitals from './reportWebVitals';
import { BrowserRouter } from "react-router-dom";

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <PaperTrade />
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);

